import './App.css';
import MainHeader from './Componants/MainHeader';
import { BrowserRouter as Router, Route, Routes, useMatch } from 'react-router-dom';
import LoginRegistration from './Componants/Login/LoginRegistration';
import Registration from './Componants/Login/Registration';
import Home from './Componants/Home';
import About from './Componants/About';

function App() {
  let match = useRouteMatch();
  return (
    <Router>
      <MainHeader />
      <Routes>
        <Route path="/"><Home /></Route>
        <Route path="/About Us"><About Us /></Route>
        <Route path="/Login"><LoginRegistration /></Route>
        <Route path={`${match.path}/:registration`}><Registration /></Route>
      </Routes>

    </Router >
  );
}

export default App;
